window.bookSummaryJSON = "<p><b>The second set of interconnected stand-alone fairy tale retellings from the Four Kingdoms series</b></p> <p>Book 3 - <i>The Princess Pact: A Twist on Rumpelstiltskin</i>: Marie, the dutiful princess of Northhelm, chafes under the rigid protocol that governs her life. Then a growing darkness threatens the kingdom and uncovers the lie at the center of her whole life - a single pact that changes everything.</p> <p>Novella 3.5 - <i>A Midwinter's Wedding: A Retelling of The Frog Prince</i>: Princess Cordelia is used to being overshadowed by her many brothers and sisters. So when she's offered the chance to attend her brother's wedding in a faraway kingdom, she leaps at it. In Northhelm, she'll finally have the chance to stand out. And maybe, just maybe, she'll even find romance.</p> <p>Book 4 - <i>The Princess Game: A Reimagining of Sleeping Beauty</i>: In this reimagining of the classic fairy tale <i>Sleeping Beauty</i>, it's only the princess's mind that is asleep. And sometimes appearances can be deceiving.</p>"; 
